  color: #8797f6;
  font-size: 14px;
  font-family: 宋体;
  font-weight: 500;
  border-radius: 15px;
}
.lan {
  width: 100%;
  height: calc(100vh - 80px);
  background: #eff3ff;
  overflow: hidden;
}
.page-bar {
  position: absolute;
  bottom: 20px;
  right: 10px;
  user-select: none;
}
.page-bar li {
  float: left;
  list-style: none;
}
.page-bar li:first-child > a {
  margin-left: 0px;
}
.page-bar a {
  border: 0;
  text-decoration: none;
  position: relative;
  text-align: center;
  margin-left: -1px;
  cursor: pointer;
  display: inline-block;
  width: 1.6vw;
  height: 1.6vw;
  line-height: 1.6vw;
  border-radius: 3px;
  background: white;
  margin: 0.5vw;
  color: black;
  font-size: 0.7vw;
  border: 1px solid gainsboro;
}
